    <div style={{ minHeight: "100vh", backgroundColor: "#f8f9fa" }}>
      <Navbar />
    </div>
    <div style={{ maxWidth: "1200px", margin: "0 auto", padding: "16px" }}>
      <Outlet /> 
    </div>
    <div>
      <footer>
        <Footer/>
      </footer>
    </div>
    </>
  );
}
